 Sure, here is a Python code snippet that implements bubble sort algorithm on an array of strings: 

```python
def bubble_sort(arr):
    n = len(arr)
    for i in range(n):
        for j in range(0, n-i-1):
            if arr[j] > arr[j+1]:
                arr[j], arr[j+1] = arr[j+1], arr[j]
    return arr
```
This function sorts an array of strings in ascending order. The time complexity of the algorithm is O(n*n) and space complexity is O(1).

