function sortStrings(arr) {
  return arr.sort((a, b) => {
    return a.toLowerCase().localeCompare(b.toLowerCase());
  });
}
```
Here's how it works:

* The function takes an array of strings as input using the `arr` parameter.
* The function uses the `sort()` method to sort the array.
* The `sort()` method takes a callback function as its second argument, which is used to compare the elements of the array. In this case, we use the `toLowerCase()` method to convert each string to lowercase, and then use the `localeCompare()` method to compare the strings. The ` localeCompare()` method compares the strings in a way that takes into account the language's collation rules, which is what we want for an alphabetical sort.
* The callback function takes two parameters: `a` and `b`. These are the two elements of the array that we want to compare. We use the `toLowerCase()` method to convert each element to lowercase before comparing them.
* The `return` statement at the end of the callback function is used to return the result of the comparison. If `a` comes before `b` in the alphabet, the function returns a negative number; if `a` comes after `b`, the function returns a positive number; and if `a` and `b` are equal, the function returns 0.
* Finally, the `return` statement at the end of the `sort()` method calls the callback function for each element of the array, passing in the element as its argument, and then returns the sorted array.

