using namespace std; 

class MonthlyBudget { 
public: 
	// Class variables 
	double essential_percent, savings_percent, discretionary_percent; 

	// Function to initialize class variables 
	void setPercentages(double essential_percent, double savings_percent, double discretionary_percent) { 
		essential_percent = essential_percent; 
		savings_percent = savings_percent; 
		discretionary_percent = discretionary_percent; 
	} 

	// Function to calculate the amount of money to allocate to each category based on user's income 
	void budget(double monthly_income) { 
		essential_budget = essential_percent * monthly_income; 
		savings_budget = savings_percent * monthly_income; 
		discretionary_budget = discretionary_percent * monthly_income; 
	} 

	// Function to track and adjust expenses throughout the month 
	void updateExpenses(double new_expense) { 
		if (new_expense > 0 && essential_budget >= new_expense) { 
			essential_budget -= new_expense; 
		} else if (discretionary_budget >= new_expense) { 
			discretionary_budget -= new_expense; 
		} else if (savings_budget >= new_expense) { 
			savings_budget -= new_expense; 
		} else { 
			cout << "Expense exceeds budget. Please try again." << endl; 
		} 
	} 

	// Function to generate a summary report at the end of each month 
	void printSummary() { 
		if (essential_budget >= savings_budget && essential_budget >= discretionary_budget) { 
			cout << "Congratulations! You have met your budget goals." << endl; 
		} else if (savings_budget < 0 || savings_budget > savings_percent * monthly_income) { 
			cout << "You should aim to save at least 20% of your income each month." << endl; 
		} else if (discretionary_budget < 0 || discretionary_budget > discretionary_percent * monthly_income) { 
